code = '''



'''.split("\n")


#keypad like
#     1
#   2 3 4
# 5 6 7 8 9
#   A B C
#     D

keypad = {
  1: {"U": None, "D": 3, "L": None, "R": None},
  2: {"U": None, "D": 6, "L": None, "R": 3},
  3: {"U": 1, "D": 7, "L": 2, "R": 4},
  4: {"U": None, "D": 8, "L": 3, "R": None},
  5: {"U": None, "D": None, "L": None, "R": 6},
  6: {"U": 2, "D": "A", "L": 5, "R": 7},
  7: {"U": 3, "D": "B", "L": 6, "R": 8},
  8: {"U": 4, "D": "C", "L": 7, "R": 9},
  9: {"U": None, "D": None, "L": 8, "R": None},
  "A": {"U": 6, "D": None, "L": None, "R": "B"},
  "B": {"U": 7, "D": "D", "L": "A", "R": "C"},
  "C": {"U": 8, "D": None, "L": "B", "R": None},
  "D": {"U": "B", "D": None, "L": None, "R": None}
  }

current = 5
secret_input = ""

for line in code:
  for move in line:
    if keypad[current][move]:
      current = keypad[current][move]
  secret_input += str(current)

print("Secret keypad code: ", secret_input)
